import React, { Component } from 'react';
import {HashRouter as Router, Route, Switch} from 'react-router-dom';

import Menu from './Components/Menu/Menu';
import 'antd/dist/antd.css';
import './App.css';

function App() {
  return (
    <>
      <Menu />
        <Switch>
          < Route path = "/"
          exact render = {
              () => < Home setTheUser = {
                this.setTheUser
              }
              loggedInUser = {
                this.state.loggedInUser
              }
              />} / >
        </Switch>
    </>
  );
}

export default App;
